import React from 'react';

import './App.css';
import Page from './Page.js'
import Home from './Home.js'
import Sidebar from './Sidebar.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";

function App() {
  return (

    <Router>
      <div className="App">
      <Sidebar/>    

        <Switch>
          <Home path="/"/>
          <Route path="/:id" children={<Page/>} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
